router.get("/report/:author_id", async (req,res) => {

    const activities = await ActivityServices.SelectAll(req.params.author_id)
    const autor = await AnimalServices.SelectOne(req.params.author_id)

    // res.send(activities)

    const body = []

    if (!Array.isArray(activities)) {
        throw new Error("A resposta da API não contém um array de atividades.");
    }
    
    for (let activity of activities) {
        if (activity.activityData) {
            const rows = []
            rows.push(activity.activityData.activityName)
            rows.push(activity.activityData.activityStart.toUTCString())
            rows.push(activity.activityData.activityEnd.toUTCString())
        
            body.push(rows)
        }
    }

    let repDateTime = new Date().toJSON()
    let repDate = repDateTime.slice(0, 10)
    let repTime = repDateTime.slice(11, 19)

    var fonts = {
        Helvetica: {
            normal: 'Helvetica',
            bold: 'Helvetica-Bold',
            italics: 'Helvetica-Oblique',
            bolditalics: 'Helvetica-BoldOblique'
        }
    }

    const printer = new PdfPrinter(fonts)

    const docDefinition = {
        defaultStyle: {font: "Helvetica"},
        content: [
        {
            columns: [
                {width: 330, text: `\nRelatório de atividades: ${autor.petName}`, style:"RepTitle"},
            ]
        },
        { text: "\nPerfil\n\n", style:"SectionTitle"},

        {
            table: {
                body: [
                    [
                        {         
                        image: 'data:image/jpeg;base64,',
                        width: 80
                        },
                        {
                            table: {
                                headerRows: 1,
                                body: [
                                    [ {text: `Animal_ID: ${autor._id}`, colSpan: 2, alignment: 'center', style: 'columnsTitle'}, {}],
                                    [ {text: `Tipo: ${autor.petCharacteristics.petType} `}, {text: `Vacinação: ${autor.petVaccCard}` }],
                                    [ {text: `Raça: ${autor.petCharacteristics.petBreed}`}, {text:`Comorbidades: ${autor.petComorbidities}` }],
                                    [ {text: `Porte: ${autor.petCharacteristics.petSize}`}, {text: `Nascimento: ${autor.petBirth.toUTCString()}` }],
                                    [ {text: `Sexo: ${autor.petGender}`}, {text: `Observações: ${autor.petObs}`}]
                                ]
                            },                           
                            margin: [30,0],
                            width: [200, '*'],
                            layout: 'headerLineOnly'
                        },    
                    ]
                ]
            },
            layout: 'noBorders'              
        },     

        { text: "\n\n Atividades na última semana: \n\n", style:"SectionTitle"},
            {
                table: {
                    body: [
                        [
                            {text: "Atividade", style: "columnsTitle"},
                            {text: "Início", style: "columnsTitle"},
                            {text: "Término", style: "columnsTitle"}
                        ],
                        ...body  
                    ]
            },
                layout: 'lightHorizontalLines', 
            },
            {
                
            },
        ],
        header: function() {
            return [
                {
            columns: [
                {width: '*', text: `\n${autor.company.companyName}`, style:"header", alignment:'center'},
                {width: '*', text: `\n${autor.company.companyCNPJ}`, style:"header", alignment:'center'},
                {width: '*', text: `\n${autor.company.companyDetails.companyPhone}`, style:"header", alignment:'center'},
            ]
        }, 
        {canvas: [{ type: 'line', x1: 50, y1: 5, x2: 630-2*40, y2: 5, lineWidth: 2 }]}       
    ]
        },   
        footer: (currentPage, pageCount) => {
            var t = {
                layout: "noBorders",
                fontSize: 10,
                margin: [30, 5, 0, 0],
                table: {
                    widths: [200,'*', "*"], 
                    body: [
                        [
                        { text: "Página  " + currentPage.toString() + " de " + pageCount, margin: [0, 10] },
                        {
                            image: 'data:image/png;base64,',
                            width: 80
                        },
                        {text: `Gerado em: ${repDate} / ${repTime}`, margin: [0, 10]}
                        ]
                    ]
                }
            }
    
          return t
        },
        styles: {
            RepTitle: {
                fontSize: 18,
                bold: true,
                alignment: 'center',
                margin: [0, 0, -180, 0]
            },
            repTime: {
                fontsize: 12,
                alignment: 'right',
                margin: [0, 8, 0, 0]
            },
            SectionTitle: {
                fontSize: 16,
                bold: true
            },
            header: {
                fontSize: 12,
                italics: true 
            },
            headerR: {
                alignment: 'right'
            },
            columnsTitle: {
                fontSize: 12,
                bold: true,
                italic: true
            }
    }
}

    const pdfDoc = printer.createPdfKitDocument(docDefinition)
    
    const chunks = []

    pdfDoc.on("data", (chunk) => {
        chunks.push(chunk)
    })


    pdfDoc.end()

    pdfDoc.on("end", () => {
        const result = Buffer.concat(chunks)
        res.end(result)
    })
    
})

export default router;